/****** Object:  View [dbo].[TecView]    Script Date: 30.01.2020 9:12:21 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO

CREATE VIEW [dbo].[TecView]
AS
SELECT		TL.Id,
			TL.PlaceId,
			TL.SystemId,
			TL.ReceiverId,
			TL.Created,
			TL.Sources,
			TL.Interval,
			TL.Site,
			TL.Position,
			AVG(TC.l1l2) AS TecAvg
FROM		dbo.TecList AS TL
LEFT JOIN	dbo.TecContent AS TC
			ON TC.Id = TL.Id
GROUP BY	TL.Id,
			TL.PlaceId,
			TL.SystemId,
			TL.ReceiverId,
			TL.Created,
			TL.Sources,
			TL.Interval,
			TL.Site,
			TL.Position
