-- =============================================
-- Author:		<Minin Anton>
-- Create date: <19.01.2020>
-- Description:	<Get Graph by Id>
-- =============================================
CREATE PROCEDURE [dbo].[Chart]
	@Id int
AS
BEGIN
	SELECT		Id,
				tsn,
				hour,
				el,
				az,
				l1l2,
				p1p2,
				validity,
				AVG(l1l2) OVER (ORDER BY Id) AS l1l2_avg
	FROM		dbo.TecContent
	WHERE		Id = @Id
END
