CREATE PROCEDURE [dbo].[Chartv]
	@Id int
AS
BEGIN
	SELECT		Id,
				time_ut,
				tec_filt_aver,
				rms,
				Xaver,
				Yaver,
				Hmax,
				DHmax,
				I0,
				DI0,
				N_of_Sats,
				AVG(tec_filt_aver) OVER (ORDER BY Id) AS tec_filt_aver_avg
	FROM		dbo.TecvContent
	WHERE		Id = @Id
END
